insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (1, 'yamaha', 'R1M', 'SuperSport', 'Yamaha ha creado la R1M de competición utilizando algunas de las tecnologías más sofisticadas desarrolladas a partir de la ganadora M1 de MotoGP.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (2, 'yamaha', 'R3', 'SuperSport', 'La carrocería estilizada y atlética de la R3 incorpora una toma de admisión de aire central inspirada en la emblemática máquina M1 de MotoGP® ganadora de Yamaha.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (3, 'honda', 'CBR650R', 'SuperSport', 'Una moto para competidores natos. Diseñada con una extraordinaria aerodinámica, la CBR650R —con suspensión, equipamiento y mejoras de estilo');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (4, 'honda', 'CBR500R', 'SuperSport', '¿Por qué competir? Para mejorar. Es lo que siempre hemos hecho. Y esta es la razón: la CBR500R es una motocicleta de permiso A2, pero también una CBR en cada milímetro cuadrado.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (5, 'yamaha', 'MT-10', 'Nacked', 'La reina de la gama MT exige un respeto total, y lo primero que llamará tu atención es el nuevo conjunto compacto de faros delanteros y el depósito rediseñado que resaltan la extraordinaria belleza mecánica de la MT-10. ');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (6, 'yamaha', 'MT-03', 'Nacked', 'Su aspecto agresivo, inspirado en las Hyper Naked de mayor cilindrada grandes de Yamaha, es más MT que nunca.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (7, 'honda', 'CB1000R', 'Nacked', 'La Neo Sports Café ha evolucionado. Comenzando con la CB1000R; completamente renovada, desde el elegante faro hasta el subchasis de aluminio remodelado, de carácter individual y agresivo.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (8, 'honda', 'CB300R', 'Nacked', '¿Buscas una nueva sensación? Añádele un extra en la conducción gracias a su peso liviano impulsado por una gran potencia con capacidad de respuesta rápida.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (9, 'honda', 'CRF450R', 'offRoad' ,'Llevamos 50 años compitiendo en motocross. Altos y bajos, lo hemos tenido todo y hemos asumido cada momento. Ganar el fin de semana es lo que nos impulsa.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (10, 'yamaha', 'YZ450F', 'offRoad' ,'Esta es la Yamaha de motocross que estabas esperando. Más ligera, más rápida y más potente, la nueva YZ450F es un nuevo tipo de máquina que ha sido desarrollada contigo, el piloto, como principal objetivo en mente.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (11, 'yamaha', 'TMAX', 'Scooter' ,'El TMAX es el rey indiscutible de los scooters. Es el scooter deportivo más vendido en Europa desde el lanzamiento del modelo original en 2001.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (12, 'honda', 'Forza 750', 'Scooter' ,'La Forza 750 está repleta de tecnología avanzada y rendimiento deportivo refinado, caracterizada por un estilo contemporáneo que llama la atención.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (13, 'Suzuki', 'V-Strom 650', 'Nacked', 'Una motocicleta adventure con un motor V-twin de 645cc y características de viaje cómodas, como un parabrisas ajustable y un asiento cómodo.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (14, 'Kawasaki', 'Ninja H2 SX SE', 'SuperSport', 'Una motocicleta superbike con un motor sobrealimentado de 998cc y una electrónica avanzada, incluyendo un sistema de control de tracción de varios niveles.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (15, 'KTM', '1290 Super Duke R', 'Nacked', 'Una motocicleta streetfighter con un motor V-twin de 1,301cc y una suspensión WP ajustable para una conducción dinámica.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (16, 'Kawasaki', 'Ninja 400', 'Nacked', 'La Kawasaki Ninja 400 es una motocicleta deportiva con un motor de 4 tiempos y 2 cilindros que produce 45 caballos de fuerza.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (17, 'Yamaha', 'R6', 'SuperSport', 'Moto deportiva de alto rendimiento con motor de 600cc y chasis de aluminio');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (18, 'Honda', 'CBR1000RR-R', 'SuperSport', 'Una motocicleta deportiva de alto rendimiento con un motor de cuatro cilindros en línea y 999 cc de cilindrada');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (19, 'Yamaha', 'MT-07', 'Naked', 'Una motocicleta naked con un motor bicilíndrico en línea y 689 cc de cilindrada, perfecta para conducción urbana y de carretera');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (20, 'Yamaha', 'X-MAX 300', 'Scooter', 'Si nos fijamos en todo lo que ofrece la XMAX 300, no es de extrañar que este elegante scooter deportivo sea uno de los modelos más vendidos de su clase');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (21, 'yamaha', 'Guantes MX', 'ropa' ,'Con el acolchado ergonómico en las palmas, los puños elásticos y un tejido superior transpirable y extensible.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (22, 'yamaha', 'Guantes Enduro', 'ropa' ,'Los guantes Enduro para hombre, imprescindibles para las duras aventuras off-road, ofrecen protección, ventilación y comodidad.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (23, 'yamaha', 'Chaqueta de carretera', 'ropa' ,'La elegante chaqueta de carretera Urban de Yamaha es ideal para la vida en la ciudad y es perfecta tanto si vas en moto como si no. ');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (24, 'honda', 'Pantalones Adventure', 'ropa' ,'Pantalones de carretera Adventure de primera calidad diseñados para combinarlos con la chaqueta Adventure Rally.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (25, 'yamaha', 'Bolsa interior para Top Case', 'equipo' ,'Bolsa flexible que se ajusta al interior del Top Case Yamaha de 34 L');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (26, 'yamaha', 'Calcetines', 'ropa','Calcetines largos para botas MX con diseño Yamaha Racing. ¡Un accesorio esencial para cualquier aventura MX!');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (27, 'Alpinestars', 'Chaqueta GP Plus R V2', 'ropa', 'Chaqueta de cuero para motocicleta con protecciones desmontables y paneles de malla para mayor ventilación');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (28, 'Shoei', 'X-Fourteen', 'casco', 'Casco de moto integral de alta gama con una carcasa externa de fibra de vidrio y carbono para la máxima protección');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (29, 'DEXTER', 'PROTON', 'casco', 'Este casco integral cuenta con una estética increíble, un diseño compacto y cómodo, calota fabricada en EPS de múltiple densidad e incluye anti-vaho.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (30, 'HJC', 'RPHA 70', 'casco', 'Este es el casco integral perfecto para el turismo deportivo, con un diseño súper deportivo pero con un enfoque de uso en tu vida cotidiana.');
insert into PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) values (31, 'Shoei', 'NEOTEC', 'casco', '¿Buscas un casco modular de diseño más dinámico, con una comodidad mejorada y con innovaciones técnicas? Shoei presenta su casco modular Neotec II:');
INSERT INTO PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) VALUES (32, 'Alpinestars', 'Guantes SP-8 V2', 'ropa', 'Guantes de moto de cuero con protecciones de nudillos y muñeca ajustable.');
INSERT INTO PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) VALUES (33, 'Shoei', 'Casco GT-Air II', 'casco', 'Casco de moto integral con visor solar integrado y sistema de ventilación avanzado.');
INSERT INTO PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) VALUES (34, 'Dainese', 'Chaqueta Avro D2', 'ropa', 'Chaqueta de moto de cuero con protecciones en codos y hombros, y forro térmico desmontable.');
INSERT INTO PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) VALUES (35, 'Brembo', 'Kit de frenos RCS 19', 'equipo', 'Sistema de frenos para moto con maneta ajustable y cilindro maestro de 19mm.');
INSERT INTO PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) VALUES (36, 'Michelin', 'Neumático Power 5', 'equipo', 'Neumático para moto de alto rendimiento en carretera, con tecnología de agarre en mojado y durabilidad mejorada.');
INSERT INTO PRODUCTO (id_articulo, marca, nombre, categoria, descripcion) VALUES (37, 'Bridgestone', 'Neumático Battlax S22', 'equipo', 'Neumático para moto de alto rendimiento en carretera y circuito, con diseño asimétrico que optimiza la tracción en la parte trasera y la estabilidad en la parte delantera.');
